"use client"
import { useState } from 'react';

export default function TestPage() {
    
    // const base64 =
    // ""

    const [b64, setB64] = useState(
        ""
    );
    
      const download = () => {
        try {
          //  base64  data URL : data:audio/mpeg;base64,xxxx 
          const pure = b64.includes(",") ? b64.split(",")[1] : b64.trim();
      
          //  base64 
          if (!pure || pure.length === 0) {
            alert("Base64 string is empty or invalid");
            return;
          }
      
          //  base64 -> Uint8Array  Blob
          const byteChars = atob(pure);
          const bytes = new Uint8Array(byteChars.length);
          for (let i = 0; i < byteChars.length; i++) bytes[i] = byteChars.charCodeAt(i);
      
          //  MP3 header (ID3 tag  MP3 sync word)
          const hasValidHeader = bytes[0] === 0x49 && bytes[1] === 0x44 && bytes[2] === 0x33; // ID3
          const hasMp3Sync = bytes[0] === 0xFF && (bytes[1] & 0xE0) === 0xE0; // MP3 sync word
          
          if (!hasValidHeader && !hasMp3Sync) {
            console.warn("Warning: File may not be a valid MP3");
          }
      
          const blob = new Blob([bytes], { type: "audio/mpeg" });
          const url = URL.createObjectURL(blob);
      
          //  .mp3
          const a = document.createElement("a");
          a.href = url;
          a.download = `audio_${Date.now()}.mp3`;
          document.body.appendChild(a);
          a.click();
          a.remove();
          URL.revokeObjectURL(url);
          
          console.log("Download completed successfully");
        } catch (error) {
          console.error("Error during download:", error);
        //   alert("Error: " + error.message);
        }
        };

    const testWithSampleAudio = () => {
        //  (1 )
        const sampleRate = 44100;
        const duration = 1; // 1 
        const frequency = 440; //  A4
        const samples = sampleRate * duration;
        const buffer = new ArrayBuffer(44 + samples * 2); // WAV header + data
        const view = new DataView(buffer);
        
        // WAV header
        const writeString = (offset: number, string: string) => {
            for (let i = 0; i < string.length; i++) {
                view.setUint8(offset + i, string.charCodeAt(i));
            }
        };
        
        writeString(0, 'RIFF');
        view.setUint32(4, 36 + samples * 2, true);
        writeString(8, 'WAVE');
        writeString(12, 'fmt ');
        view.setUint32(16, 16, true);
        view.setUint16(20, 1, true);
        view.setUint16(22, 1, true);
        view.setUint32(24, sampleRate, true);
        view.setUint32(28, sampleRate * 2, true);
        view.setUint16(32, 2, true);
        view.setUint16(34, 16, true);
        writeString(36, 'data');
        view.setUint32(40, samples * 2, true);
        
        // 
        for (let i = 0; i < samples; i++) {
            const sample = Math.sin(2 * Math.PI * frequency * i / sampleRate) * 0.3;
            view.setInt16(44 + i * 2, sample * 32767, true);
        }
        
        //  base64
        const uint8Array = new Uint8Array(buffer);
        // const base64 = btoa(String.fromCharCode.apply(null, Array.from(uint8Array)));
        
        // 
        const blob = new Blob([uint8Array], { type: "audio/wav" });
        const url = URL.createObjectURL(blob);
        const a = document.createElement("a");
        a.href = url;
        a.download = `test_audio_${Date.now()}.wav`;
        document.body.appendChild(a);
        a.click();
        a.remove();
        URL.revokeObjectURL(url);
        
        console.log("Test audio generated and downloaded");
    };
      
    return (
        <div className="p-4">
            <div className="p-4 space-y-3">
                <textarea
                    className="w-full p-3 border rounded"
                    rows={6}
                    value={b64}
                    onChange={(e) => setB64(e.target.value)}
                    placeholder=" base64 "
                />
                <button onClick={download} className="px-3 py-2 border rounded">
                     MP3
                </button>
                <button onClick={testWithSampleAudio} className="px-3 py-2 border rounded bg-blue-500 text-white ml-2">
                    
                </button>
            </div>
            <audio controls src={`data:audio/mpeg;base64,${b64.includes(",") ? b64.split(",")[1] : b64.trim()}`} />

        </div>
    )
}